import React, {useState} from 'react'
import './styles/App.css'
import Table from './components/Table'

function App() {
  const [headers] = useState([
    { id: 1, name: "Дата" },
    { id: 2, name: "Название" },
    { id: 3, name: "Количество" },
    { id: 4, name: "Расстояние" },
  ]);
  return (
    <div className="App">
      <h1>Некие данные</h1>
      <Table headers={headers} />

    </div>
  );
}

export default App;
